DESCRIPTION:
This test verifies that the pet's name can be updated.

### Test input
**Pet data:**

```json
{
  "id": 12345,
  "name": "Snowball",
  "category": {
    "id": 1,
    "name": "Cats"
  },
  "photoUrls": [
    "https://example.com/photo"
  ],
  "tags": [
    {
      "id": 1,
      "name": "sometag"
    }
  ],
  "status": "available"
}
```

Creates a new pet and verifies the response contains correct data.

